import {Container } from "react-bootstrap";
import Header from "./components/Header";
import React  from 'react';
import Footer from "./components/Footer";
import HomeScreen from "./screens/HomeScreen";

const products = [
  {
      name: "All Time Low"
  },
  {
      name: "5sos"
  }
];



const App = () => {
  return (
    <>
      <Header />
      <main className="py-3">
        <Container>
          <HomeScreen />
      </Container>
      </main>
      <Footer />
    </>
  )
};

export default App
